import React from "react";

function App ()
{
  return (
    <>
      Guided Capstone Project
      <div className={styles["app"]}>
          <header className={styles["app__header"]}>
            <NavigationBar />
          </header>

          <main className={styles["app__main"]}>
            <AppRoute />
          </main>

          <footer className={styles["app__footer"]}>
            <Motto />
          </footer>
        </div>
    </>
  );
}

export default App;
